description:
Eva is the new weather girl at WQAX-TV. Although she is slightly nervous about her first day on the job, she is confident she will
do well and fit in just fine with the rest of the news staff. Unfortunately the rest of the staff do not share that feeling. In an attempt to
sabotage her on air (using gags via the control booth), the crew at WQAX hope to succeed in their devious attempts. But what they didn't count
on was for Eva to retaliate in a big big way, exacting revenge on them with her jumbo dumbo succulent breasts!

